        WWHFrame.WWHJavaScript.mPanels.fInitLoaded();
      }
    }

    // Write Init Head HTML
    //
    if (WWHFrame.WWHHelp.mInitStage > 0)
    {
      document.writeln(WWHFrame.WWHJavaScript.mPanels.fInitHeadHTML());
    }
   // -->
  </script>
 </head>

   // -->
  </script>
